
var sarabunNormal = "";
var sarabunBold = "";

if (typeof window !== "undefined" && window.jspdf) {
  window.jspdf.jsPDF.API.events.push([
    "addFonts",
    function () {
      this.addFileToVFS("Sarabun-Regular.ttf", sarabunNormal);
      this.addFont("Sarabun-Regular.ttf", "Sarabun", "normal");
      this.addFileToVFS("Sarabun-Bold.ttf", sarabunBold);
      this.addFont("Sarabun-Bold.ttf", "Sarabun", "bold");
    }
  ]);
}
